    const [nRadius, setRadius] = useState(null);

    const handleLatLngChange = (latLng) => {
        console.log("New clickedLatLng:", latLng);
        setClickedLatLng(latLng);
    };

    const handleRadiusChange = (nRadius) => {
        console.log("radius (App.js): ", nRadius)
        setRadius(nRadius)
    }   
    
    return (
        <div className='body'>
            <Header/>
            <SearchAndMap/>
        </div> 
    )
}

export default App;
